exports.string = "<ack-modal *ngIf=\"testRoute\" (onClose)=\"testRoute=null\" [@500]=\"'fadeInUp'\" [wrapStyle]=\"{width:'100%', 'max-width':'900px'}\"><div class=\"bg-white border border-grey-4x pad radius-5\"><test-route [(hostModel)]=\"hostModel\" [route]=\"testRoute\" [hosts]=\"rjon.hosts\"></test-route></div></ack-modal><ack-modal *ngIf=\"editRoute\" (onClose)=\"editRoute=null\" [@500]=\"'fadeInUp'\" [wrapStyle]=\"{width:'100%', 'max-width':'900px'}\"><div class=\"bg-white border border-grey-4x pad radius-5\"><edit-route [(hostModel)]=\"hostModel\" [route]=\"editRoute\" [hosts]=\"rjon.hosts\" (onChange)=\"onChange.emit(rjon)\"></edit-route><br/><a class=\"block bg-grey-5x pad text-center hover-bg-grey-6x hover-text-grey-3x\" (click)=\"editRoute=null\">close</a></div></ack-modal><rjon-links class=\"text-right text-sm\" [rjon]=\"rjon\"></rjon-links><div class=\"markdown-body\"><h3>Table of Hosts</h3><table-of-hosts [hosts]=\"rjon.hosts\"></table-of-hosts><h3>Table of Routes</h3><table-of-routes [routes]=\"rjon.routes\" links=\"1\"></table-of-routes><br/><h2>Route Definitions</h2><div *ngFor=\"let route of (rjon ? rjon.routes : [])\"><div style=\"padding:.4em;\"><div class=\"flex-valign-center\"><h3 id=\"{{ route.method+':'+route.path | markdownAnchor }}\">{{ route.path }}</h3><div class=\"flex-1 text-right child-margin-xxs\"><button class=\"text-md\" (click)=\"testRoute=route\">test</button><button class=\"text-md\" (click)=\"editRoute=route\">edit</button></div></div><ul><li *ngFor=\"let status of route.status|array\">{{ statIconMap[status].icon }} &nbsp;{{ statIconMap[status] ? statIconMap[status].details : '' }}</li><li *ngIf=\"route.details\">{{ route.details }}</li><li *ngFor=\"let note of route.notes|array\">{{ note }}</li><li *ngIf=\"route.method\">method: {{ route.method }}</li><li *ngIf=\"route.returnType\">return-type: {{ route.returnType }}</li><li *ngIf=\"route.status &amp;&amp; !route.status.forEach\">{{ statIconMap[status].icon }} &nbsp;{{ statIconMap[route.status] ? statIconMap[route.status].details : '' }}</li><li *ngFor=\"let host of rjon.hosts\"><div *ngFor=\"let sample of defToArray(route.sample); let i=index\"><form action=\"{{ serverUrlByRoute(host, route, sample) }}\" method=\"{{ route.method || 'GET' }}\" enctype=\"{{ sample.fileNames ? 'multipart/form-data' : 'application/json' }}\" target=\"_blank\" style=\"display:inline-block;padding:0.2em;\"><div *ngIf=\"['file','pdf'].indexOf(route.returnType)&gt;=0\">Loading...&nbsp;</div><div><a class=\"result-link\" href=\"{{ serverUrlByRoute(host, route, sample) }}\" target=\"_blank\">{{host.hostname}}</a></div></form></div></li></ul><ul *ngFor=\"let sample of defToArray(route.sample)\"><li *ngIf=\"sample.test\">Sample Test<ul *ngFor=\"let test of defToArray(sample.test); let i=index\"><li *ngIf=\"test.statusCode\">Expects statusCode {{test.statusCode}}</li><li *ngIf=\"test.body\" #showBody=\"var\" [var]=\"false\"><button (click)=\"showBody.var=!showBody.var\">request-body</button><div *ngIf=\"showBody.var\" [@500]=\"'fadeInUp'\"><absolute-overflow-y><pre class=\"code-sample\">{{ test.body | json}}</pre></absolute-overflow-y></div></li></ul></li><li *ngIf=\"sample.response\" #showBody=\"var\" [var]=\"false\"><button (click)=\"showBody.var=!showBody.var\">sample response</button><div *ngIf=\"showBody.var\" [@500]=\"'fadeInUp'\"><absolute-overflow-y><pre class=\"code-sample\">{{ sample.response | json }}</pre></absolute-overflow-y></div></li><li *ngIf=\"sample.request\" #showBody=\"var\" [var]=\"false\"><button (click)=\"showBody.var=!showBody.var\">sample request</button><div *ngIf=\"showBody.var\" [@500]=\"'fadeInUp'\"><absolute-overflow-y><pre class=\"code-sample\">{{ sample.request | json}}</pre></absolute-overflow-y></div></li></ul></div></div></div>";
